  `__CREATE_TIME__` datetime NOT NULL,
  `__MODIFY_TIME__` datetime NOT NULL,
  `__REMOVED__` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `shopnc_sp_id` int(11) DEFAULT NULL,
  `shopnc_class_id` int(11) DEFAULT NULL,
